import { Link } from "react-router-dom";
// import {Button} from "../../componenets/Button";
import logo from "../../images/DWEAR Logo.png";
import styles from "./styles.module.scss";

const nav_links = [
    {name: "Sign up", link: "/signup"},
    {name: "Log in", link: "/login"}
];

const Main = () => {
    return(
        <div className={styles.container}>
            <nav className={styles.navbar_container}>
                <Link to="/" className={styles.nav_logo}>
                    <img src={logo} alt="logo"/>
                </Link>
                <div className={styles.nav_links}>
                    {
                        nav_links.map((link, idx) => {
                            <Link key={idx} to={link.link} className={styles.links}>{link.name}</Link>
                        })
                    }
                </div>
            </nav>
            <main className={styles.main_container}>
                    <div className={styles.main}>
                        <h1>Clothing is everything.</h1>
                        <p>Time to manage your daily outfit with DWEAR.</p>
                        <Link to="/signup">
                            <Button label="GET DWEAR FREE" style={{color: "#111111", width: "18rem", fontSize: "1.4rem"}}></Button>
                        </Link>
                    </div>
            </main>
            <footer className={styles.footer_container}>
                <div className={styles.footer_1}>
                    <Link to="/" className={styles.footer_logo}>
                        <img src={logo} alt="logo"/>
                    </Link>
                </div>
            </footer>
        </div>
    );
}

export default Main;
